import Materi from "../elements/Materi";
import Price from "../elements/Price";

const ProductDetail = () =>  {
    return (
        <div className="flex justify-center bg-blue-100 pt-4  px-12 mb-6">
            <div className="flex w-2/12 border-black ml-6">
               <Price/>
            </div>
            <div className="w-10/12 flex flex-wrap">
                <Materi/>
            </div>
        </div>
    )
}

export default ProductDetail;
